// SPDX-License-Identifier: UNLICENSED
pragma solidity >=0.4.22 <0.8.0;

contract TLSDIDContract {
    address private owner = msg.sender;
    string public signature;
    Attribute[] public attributes;

    struct Attribute {
        string name;
        string value;
    }

    constructor() public {
        owner = msg.sender;
    }

    function setSignature(string calldata _signature) external {
        require(msg.sender == owner);
        signature = _signature;
    }

    function addAttribute(string calldata name, string calldata value)
        external
    {
        require(msg.sender == owner);
        attributes.push(Attribute(name, value));
    }

    function getAttribute()
        external
        view
        returns (string memory, string memory)
    {
        return (attributes[0].name, attributes[0].value);
    }
}
